import React, { useState } from 'react';
import Navbar from './Navbar';
import Stock from './pages/Stock';
import Clients from './pages/Clients';
import Commandes from './pages/Commandes';

const App = () => {
  const [activePage, setActivePage] = useState('stock');

  const renderPage = () => {
    switch (activePage) {
      case 'stock':
        return <Stock />;
      case 'clients':
        return <Clients />;
      case 'commandes':
        return <Commandes />;
      default:
        return <Stock />;
    }
  };

  return (
    <div className="App">
      <Navbar setActivePage={setActivePage} /> {/* Passer setActivePage ici */}
      {renderPage()}
    </div>
  );
};

export default App;
